   var currand = 0;

   function getrand(){
      currand = (currand+1)%10000;
      return(rands[currand]);
   }

   function getrand_signed(){
      currand = (currand+1)%10000;
      return(rands[currand]*2.0-1.0);
   }

   function getrand_i(seed){
      var tcurrand = seed%10000;
      return(rands[tcurrand]);
   }


   function getrand_if(seed){
      var mixval = seed - Math.floor(seed);
      var tcurrand = Math.floor(seed)%10000;
      return(mix(rands[tcurrand],rands[(tcurrand+1)%10000],mixval));
   }

   function getrand_i_signed(seed){
      var tcurrand = seed%10000;
      return(rands[tcurrand]*2.0-1.0);
   }


   var curitrand = 0;
   function itrand_reset(val){
      curitrand = val || 0;
   }
   function itrand(){
      curitrand = (curitrand+1)%10000;
      return(rands[curitrand]);
   }

   function shuffle_itrand(array) {
      return(array.sort(() => itrand() - 0.5));
   }


